import { Login } from '../views';
import Beranda from '../views/beranda/beranda';
import Absensi from '../views/absensi/absensi';
import Penilaian from '../views/penilaian/penilaian';

export const MainRoutes = [
    // {
    //     path: '/',
    //     component: Login
    // },
    {
        path: '/home',
        component: Beranda
    },
    {
        path: '/absensi',
        component: Absensi
    },
    {
        path: '/penilaian',
        component: Penilaian
    }
];
